	<script>
	var formular = document.getElementById("formular");
	var oblast = document.getElementById("oblast");
	var godina = document.getElementById("godina");
	var mesec = document.getElementById("mesec");
	var dan = document.getElementById("dan");
	var tekst_tabla = document.getElementById("tekst-tabla");
	var upozorenje = document.getElementById("upozorenje");
	var opis = document.getElementById("opis");
	var potvrdi = document.getElementById("potvrdi");
	
	function prikaziIzbor(tekuca_oblast){
	
		oblast.value = tekuca_oblast;	
		var prikazi_dan = dan.value == 0 ? "" : dan.value;
		
		var tekst_opisa = napraviOpis(tekuca_oblast) + prikazi_dan + " " + prevediMesec(mesec.value) + " " + godina.value;
		tekst_tabla.innerHTML = opis.value = tekst_opisa;

		bojiOblast(tekuca_oblast);
	}

	function bojiOblast(tekuca_oblast){
		var sve_oblasti = document.getElementsByTagName("path");
		for (var i = 0; i < sve_oblasti.length; i++) {
			sve_oblasti[i].style.fill = "#333"
		}
		document.getElementById(tekuca_oblast).style.fill = "#BF0000";		
	}
	
	function bojiPoslatuOblast(){
		if(oblast.value){
			tekuca_oblast = oblast.value;
			bojiOblast(tekuca_oblast);
		}
	}
	
	function daljinskiSaljeFormular(){ 
		document.formular.submit(); 
	} 
	
	function prevediMesec(naziv_meseca){
		if(naziv_meseca==0) naziv_meseca = "";
		if(naziv_meseca==1) naziv_meseca = "januara";
		if(naziv_meseca==2) naziv_meseca = "februara";
		if(naziv_meseca==3) naziv_meseca = "marta";
		if(naziv_meseca==4) naziv_meseca = "aprila";
		if(naziv_meseca==5) naziv_meseca = "maja";
		if(naziv_meseca==6) naziv_meseca = "juna";
		if(naziv_meseca==7) naziv_meseca = "jula";
		if(naziv_meseca==8) naziv_meseca = "avgusta";
		if(naziv_meseca==9) naziv_meseca = "septembra";
		if(naziv_meseca==10) naziv_meseca = "oktobra";
		if(naziv_meseca==11) naziv_meseca = "novembra";
		if(naziv_meseca==12) naziv_meseca = "decembra";
		return naziv_meseca;
	}

	function napraviOpis(naziv_oblasti){
		if(naziv_oblasti == 18) naziv_oblasti = "Borbe širom Jugoslavije ";
		if(naziv_oblasti == 3) naziv_oblasti = "Borbe u Bosni i Hercegovini ";
		if(naziv_oblasti == 2) naziv_oblasti = "Borbe u Crnoj Gori ";
		if(naziv_oblasti == 4) naziv_oblasti = "Borbe u Hrvatskoj ";
		if(naziv_oblasti == 6) naziv_oblasti = "Borbe na Jadranu ";
		if(naziv_oblasti == 16) naziv_oblasti = "Borbe u Makedoniji ";
		if(naziv_oblasti == 5) naziv_oblasti = "Borbe u Sloveniji ";
		if(naziv_oblasti == 11) naziv_oblasti = "Borbe u Srbiji ";
		if(naziv_oblasti == 18) naziv_oblasti = "Borbe u Jugoslaviji ";
		return naziv_oblasti;
	}
	
	function validacija(){
		if(!oblast.value) {
			upozorenje.innerHTML = "Oblast nije izabrana. ";
			return false;
		// samo ako je izabran dan bez meseca
		} else if(dan.value && !mesec.value){
			upozorenje.innerHTML = "Mesec nije izabran. ";
			return false;		
		} else {
			return true;
		}
	}

	function ponovoUcitaj(){
		window.location.href = window.location.href;
	}
	
